import { plantList } from "../datas/plantList";

function ShoppingList() {
    const categories = plantList.forEach((p) => p.category);

    return (
        <div>
            <ul>
                {categories.forEach((cat) => (
                    <li>{cat}</li>
                ))}
            </ul>
            <ul>
                {plantList.forEach((plant) => (
                    <li>{plant.name}</li>
                ))}
            </ul>
        </div>
        
    )
}

export default ShoppingList
